import React from "react";
import { motion } from "framer-motion";

const imgs = [
  "https://images.unsplash.com/photo-1568572933382-74d440642117?q=80&w=1200&auto=format&fit=crop",
  "https://images.unsplash.com/photo-1548199973-03cce0bbc87b?q=80&w=1200&auto=format&fit=crop",
  "https://images.unsplash.com/photo-1534361960057-19889db9621e?q=80&w=1200&auto=format&fit=crop",
  "https://images.unsplash.com/photo-1602067340370-bdcebe8d1930?q=80&w=1200&auto=format&fit=crop",
  "https://images.unsplash.com/photo-1558944351-cd33dc9922fe?q=80&w=1200&auto=format&fit=crop",
  "https://images.unsplash.com/photo-1619983081593-75dfc9ad479f?q=80&w=1200&auto=format&fit=crop",
];

export default function Gallery() {
  return (
    <section id="gallery" className="section-anchor py-20">
      <div className="max-w-6xl mx-auto px-6">
        <h2 className="text-3xl md:text-4xl font-extrabold text-green-800 text-center">
          Gallery
        </h2>
        <p className="text-center text-gray-600 mt-2">
          Add your actual photos later â€” these are placeholders.
        </p>

        <div className="mt-10 grid sm:grid-cols-2 lg:grid-cols-3 gap-4">
          {imgs.map((src, i) => (
            <motion.div
              key={src}
              initial={{ opacity: 0 }}
              whileInView={{ opacity: 1 }}
              viewport={{ once: true }}
              transition={{ duration: 0.5, delay: i * 0.05 }}
              className="overflow-hidden rounded-2xl shadow"
            >
              <img
                src={src}
                alt={`Happy dog ${i + 1}`}
                className="h-56 w-full object-cover hover:scale-105 transition"
              />
            </motion.div>
          ))}
        </div>
      </div>
    </section>
  );
}
